  input: '"TEXT","F3XA","C00167320","FEC Amendment for May 2007 Report (April 1, 2007
    -April 30, 2007)    Q.1. All contributions were disclosed on the original May
    monthly report. Due to a software coding issue on the original report, not all
    of the contributions that were disclosed on the original Schedule A pulled to
    the Detailed Summary page although the total listed on the bottom of the final
    page of Schedule A for Line 11.a.i totaled $132,972.    Q.2. Page 4 of the RFAI
    is a list of state political action committees and town committees that contributed
    to our committee, all contributions made were from federally permissible sources.  The
    contribution from People for Excellence in Government in the amount of $2,220
    was inadvertently deposited into our federal account, when the error was discovered,
    $2,200 was moved as a corrective transfer into the committees nonfederal account.  While
    working on this RFAI it was discovered that due to a typographical error, the
    corrective transfer was $20 short of the total original deposit, so a check was
    cut today in the amount of $20 to correct this.  Q3. The expenditures made for
    Event Sound, Lighting, and Staging, Catering Fee, Catering Fees and Catering Fee
    balance were for a Party event and were not made on behalf of any specifically
    identified federal candidates.  -Due to an error in a previous report, the Cash-on-Hand
    Line 6 and Line 8 numbers were incorrect, as were the numbers on the Schedule
    L the previous report and these numbers have been amended and are now correct."'
